    "2015-09-26T21:05:16.217605",nt"name": "noaas-hydrographic-surveys-and-reports",nt"isopen":
    false,nt"url": null,nt"notes": "The National Oceanic and Atmospheric Administration
    (NOAA) has the statutory mandate to collect hydrographic data to support the compilation
    of nautical charts and for safe navigation and to provide basic data for engineering,
    scientific and other commercial and industrial activities. Hydrographic survey data
    consists primarily of water depths but also includes features (rocks, wrecks, etc.),
    navigational aids, shoreline and some bottom type information. Such data can also
    be used for storm surge modeling and fish habitat studies and support a variety
    of maritime functions such as port and harbor maintenance, coastal engineering,
    and coastal zone management.",nt"license_title": null,nt"extras": [{ntt"key":
